import React, { useState, useEffect } from 'react';
import Appbar from '../surface/Appbar';
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';
import AboutSection from './AboutSection';
import ContactSection from './ContactSection';

import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import AdbIcon from '@mui/icons-material/Adb';
import { styled } from '@mui/system';
import HomeSection from './HomeSection';

const pages = ['About', 'Contact', 'Sign in'];
const HoverButton = styled(Button)({
  transition: 'transform 0.2s ease-in-out, border-bottom-color 0.2s ease-in-out',
  borderBottom: '5px solid transparent',
  borderRadius: 0,
  '&:hover': {
    transform: 'scale(1.1)',
    borderBottomColor: '#F2B569',
  },
});

const HoverMenuIcon = styled(MenuIcon)({
 
  transition: 'transform 0.2s ease-in-out, color 0.2s ease-in-out',
  '&:hover': {
    transform: 'scale(1.2)',
    color: '#F2B569',
  },
});

function Dashboard() {
  const [currentImage, setCurrentImage] = useState(0);
  const imageSources = [schlogo, uccplogo]; // Add more image sources as needed
  const [anchorElNav, setAnchorElNav] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  useEffect(() => {
    const intervalId = setInterval(() => {
      setCurrentImage((prevImage) => (prevImage + 1) % imageSources.length);
    }, 3000); // Adjust the interval time as needed

    return () => clearInterval(intervalId); // Cleanup interval on component unmount
  }, [imageSources.length]);

  const imageStyles = {
    image1: { height: '30rem', width: '30rem' }, // Adjust the height and width for the first image
    image2: { height: '30rem', width: '30rem' }, // Adjust the height and width for the second image
    // Add more styles for additional images as needed
  };

  const currentImageStyle = imageStyles[`image${currentImage + 1}`];

  return (
    
    <div className='flex flex-col'>
      <AppBar position="static" sx={{ bgcolor: '#079440' }}>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <img src={uccplogo} alt="" className="h-12 w-12 lg:h-20 lg:w-20 transition-all duration-300" />
          <img src={schlogo} alt="" className="h-16 w-16 lg:h-24 lg:w-24 transition-all duration-300" />

          <Typography
            variant="h6"
            noWrap
            component="a"
            href="#app-bar-with-responsive-menu"
            sx={{
              ml: 2,
              display: { md: 'flex', xs: 'none' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
              fontSize: { md: '20px' },
            }}
          >
            CAGAYAN DE ORO CHRISTIAN SCHOOL - UCCP
          </Typography>

          <Typography
            variant="h5"
            noWrap
            component="a"
            href="#app-bar-with-responsive-menu"
            sx={{
              ml: 1,
              display: { xs: 'flex', md: 'none' },
              flexGrow: 1,
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
              fontSize: { xs: '18px' },
              alignItems: { xs: 'center' },
            }}
          >
            COCS-UCCP
          </Typography>
          <Box
            sx={{
              ml: 'auto',
              mr: -2,
              display: { md: 'none', lg: 'flex', xs: 'none' },
            }}
          >
            {pages.map((page) => (
              <HoverButton
                key={page}
                onClick={handleCloseNavMenu}
                sx={{
                  mx: 2,
                  color: 'white',
                  display: 'block',
                  fontWeight: 600,
                }}
              >
                {page}
              </HoverButton>
            ))}
          </Box>
          <Box
            sx={{
              flexGrow: 1,
              display: { md: 'flex', lg: 'none', xs: 'flex' },
              justifyContent: 'flex-end',
              
            }}
          >
             <HoverMenuIcon
                size="large"
                aria-label="account of current user"
                aria-controls="menu-appbar"
                aria-haspopup="true"
                onClick={handleOpenNavMenu}
                color="inherit"
            />
            <Menu
              id="menu-appbar"
              anchorEl={anchorElNav}
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'left',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'left',
              }}
              open={Boolean(anchorElNav)}
              onClose={handleCloseNavMenu}
              sx={{
                display: { md: 'block', lg: 'none' },
              }}
            >
              {pages.map((page) => (
                <MenuItem key={page} onClick={handleCloseNavMenu}>
                  <Typography textAlign="center">{page}</Typography>
                </MenuItem>
              ))}
            </Menu>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
      <HomeSection/>
      <AboutSection/>
      <ContactSection/>
    </div>
  );
}

export default Dashboard;
